import Link from 'next/link'
// COMPONENTS
import Layout from "../resources/js/index";
import Home from "../resources/js/components/home/home";

const Index = () => (
  <div>
    <p>Hello Next.js</p>
    <Link href="/about" title="About Us">
        <a>About Page</a>
    </Link>
    <Layout>
        <Home/>
    </Layout>
  </div>
);

export default Index;
